import { Modal,Button } from "react-bootstrap";
type ShapeModalProps={
    isOpen:boolean;
    onClose:()=>void;
    onShapeSelect:(shape:"square"|"circle"|"triangle")=>void
}
const ShapeModal = ({isOpen,onClose,onShapeSelect}:ShapeModalProps) => {
  return (
    <Modal show={isOpen} onHide={onClose}>
      <Modal.Header>
        <Modal.Title>Choose a Shape</Modal.Title>
      </Modal.Header>
      <Modal.Body>
      <div className="shape-container">
          <div draggable onDragStart={() => onShapeSelect('square')} className="shape square">Square</div>
          <div draggable onDragStart={() => onShapeSelect('circle')} className="shape circle">Circle</div>
          <div draggable onDragStart={() => onShapeSelect('triangle')} className="shape triangle">Triangle</div>
        </div>
      </Modal.Body>
      <Modal.Footer>
        <Button variant="secondary" onClick={onClose}> Close</Button>
      </Modal.Footer>
    </Modal>
  );
};
export default ShapeModal;
